import "./App.css"

const App = () => {
  return ( 
    <div className='App'>
        <h1 className='Text'>Login</h1>
        <p className='Text'>Email:<input type="text" /></p><br />
        <input type="text" /><br />
        <button className='button' type="submit">Enviar</button>
    </div>
   );
}

export default App;
